import React from 'react';

const MergeSortInformation = () => {
    return (
        <div className="information">
            <h1>Merge Sort</h1>
            <p>Merge Sort is a divide and conquer algorithm for sorting an array. First the array is split up into several sub-arrays of size 1. Then every pair of arrays is merged in such a way that the new merged array contains the elements of the two previous arrays in sorted order. This is repeated until all arrays have been merged into one final sorted array.</p>
            <br />
            <p></p>
            <br />
            <p>To find the minimum element of the unsorted subarray, a linear scan is used where the smallest element is kept track of. Then the minimum can be swapped with the beginning in costant time. The linear scan portion takes n comparisons the first time, n-1 comparisons the second time, and so on until there is 1 comparison on the last scan. Because of this the overall time complexity is O(n<sup>2</sup>). Since all of the swaps are done in place for selection sort, the space complexity is constant.</p>
            <br />
            <table>
                <tbody>
                    <tr><th>Merge Sort</th><th>Complexity</th></tr>
                    <tr><td>Time Complexity</td><td>O(n log n)</td></tr>
                    <tr><td>Space Complexity</td><td>O(n)</td></tr>
                </tbody>
            </table>
        </div>
    );
}

export default MergeSortInformation;
